import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';

function Dashboard() {
  const [commissionData, setCommissionData] = useState(null);
  const [violationsData, setViolationsData] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    const userEmail = localStorage.getItem('userEmail');
    if (!userEmail) {
      navigate('/'); // Redirect to login if not logged in
      return;
    }

    const fetchData = async () => {
      const response = await fetch(`https://us-central1-optimal-comfort-464220-t1.cloudfunctions.net/loginHandler?email=${userEmail}`);
      const result = await response.json();
      if (result.success) {
        setCommissionData(result.commissionData);
        setViolationsData(result.violationsData);
      } else {
        alert("Failed to fetch data");
      }
    };

    fetchData();
  }, [navigate]);

  const handleLogout = () => {
    localStorage.removeItem('userEmail');
    navigate('/');
  };

  if (!commissionData) return <div>Loading...</div>;

  return (
    <div style={{ fontFamily: "Arial, sans-serif", backgroundColor: "#f7f7f7", minHeight: "100vh" }}>
      {/* Top nav */}
      <div style={{ backgroundColor: "#d71920", color: "#fff", padding: "10px 20px", display: "flex", justifyContent: "space-between", alignItems: "center" }}>
        <div style={{ display: "flex", alignItems: "center" }}>
          <img src="/fiesta-logo.png" alt="Fiesta Logo" style={{ height: "40px", marginRight: "10px" }} />
          <h2 style={{ margin: 0 }}>Agent Portal</h2>
        </div>
        <div>
          <strong>{commissionData.agentname || "Agent"}</strong>
          <button onClick={handleLogout} style={{ marginLeft: "20px", padding: "5px 10px", cursor: "pointer", backgroundColor: "#f4c542", border: "none", borderRadius: "4px" }}>Logout</button>
        </div>
      </div>

      {/* Dashboard content */}
      <div style={{ maxWidth: "900px", margin: "20px auto", padding: "20px", backgroundColor: "#fff", borderRadius: "8px" }}>
        <h2 style={{ color: "#d71920" }}>📝 Weekly Commission</h2>
        <div style={{ backgroundColor: "#f9f9f9", padding: "10px", borderRadius: "5px" }}>
          {Object.entries(commissionData).map(([key, value]) => (
            <div key={key} style={{ marginBottom: "4px" }}>
              <strong>{key}:</strong> {value || "N/A"}
            </div>
          ))}
        </div>

        <h2 style={{ color: "#d71920", marginTop: "20px" }}>⚠️ Scanning Violations & ARs</h2>
        {violationsData.length > 0 ? (
          violationsData.map((violation, index) => (
            <div key={index} style={{ backgroundColor: "#fff5f5", padding: "10px", border: "1px solid #d71920", borderRadius: "5px", marginBottom: "10px" }}>
              {Object.entries(violation).map(([key, value]) => (
                <div key={key}>
                  <strong>{key}:</strong> {value || "N/A"}
                </div>
              ))}
            </div>
          ))
        ) : (
          <p>No violations found.</p>
        )}
      </div>
    </div>
  );
}

export default Dashboard;
